#   030
#   Substring with Concatenation of All Words
#   2015-05-08
#####################################################
import collections
import copy

class Solution:
    # @param {string} s
    # @param {string[]} words
    # @return {integer[]}
    def findSubstring(self, s, words):
        v = []
        num = len(words)
        if num == 0:
            return v
        size = len(words[0])
        if size == 0:
            return v
        length = len(s)
        sublen = size * num
        dict = collections.defaultdict(int)
        for word in words:
            dict[word]+=1

        for word in dict:
            print(word, dict[word])
        for j in range(size):
            tdict = collections.defaultdict(int)
            i = j
            while i <= length - size:
                word = s[i:i+size]
                if word in dict:
                    tdict[word] += 1
                    while tdict[word] > dict[word]:
                        tdict[s[j:j+size]] -= 1
                        j += size
                    if i - j == sublen - size:
                        v.append(j)
                        tdict[s[j:j+size]] -= 1
                        j += size
                else:
                    j = i + size
                    tdict.clear()
                i += size
        return v
        
